    List<PaymentReceiveView> articleModel;
    List<AccountLedgerView> listSupplier = new List<AccountLedgerView>();
    PaymentMaster view;
    string voucherNo = string.Empty;
    DateTime FromDate = DateTime.Now;
    DateTime ToDate = DateTime.Now;
    long LedgerId = 0;
    string Email;
    protected async override void OnInitialized()
    {
        LoadData();
    }
    protected void LoadData()
    {
        articleModel = _payment.ViewAllPaymentSupplier(LedgerId, 1, 1, voucherNo);
        listSupplier = accountLedger.ViewAllSupplier(1);
    }
    async Task Delete(long id)
    {
            bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Are you sure?");
            if (confirmed)
            {
                view = _payment.EditPaymentSupplier(id);
                bool isSave = false;
                isSave = _payment.DeletePaymentSupplier(view.VoucherNo, view.VoucherTypeId, view.FinancialYearId, view.CompanyId);
                if (isSave == true)
                {
                    Snackbar.Add("Deleted Successfully.", Severity.Success);
                    LoadData();
                }
                else
                {
                    Snackbar.Add("Cannot be delete. already in used.", Severity.Success);
                    navManager.NavigateTo("/purchase/supplierpayslist");
                }
            }
    }

